import React, { Component } from "react";
import Nav from "../../Components/Nav/Nav";
import "./SignUp.scss";

class SignUp extends Component {
  render() {
    return (
      <div className="SignUp">
        <Nav />
        <section className="section">
          <div className="signUpCenter">
            <div className="">
              <h2>나이키 멤버 가입</h2>
            </div>
          </div>
        </section>
      </div>
    );
  }
}

export default SignUp;
